pub enum SliceCheckError<T> {
    CheckBytes {
        index: usize,
        error: T,
    },
}

pub enum EnumCheckError<T> {
    InvalidStruct {
        variant_name: &'static str,
        inner: StructCheckError,
    },
    InvalidTuple {
        variant_name: &'static str,
        inner: TupleStructCheckError,
    },
    InvalidTag(T),
}
